import styled from 'styled-components'

export const Container = styled.div`
    
        margin: 0;
        padding: 0;

.conteudo{

    display: flex;
    justify-content: space-between;
    
    .barraEsquerda{
        width:20%;
        background-color: red;
        display: flex;
        justify-content: center;
    }

    .barraCentral{
        width: 60%;
        background-color: blue;
        display: flex;
        justify-content: center;
    }

    .barraDireita{
        width:20%;
        background-color: green;
        display: flex;
        justify-content: center;

    }

}

`
